import org.apache.commons.collections4.map.MultiKeyMap;
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        MultiKeyMap<String, Integer> map = new MultiKeyMap<>();
        Map<String, Integer> hashMap = new HashMap<>();

        // Adding entries to the hashMap
        hashMap.put("A", 10);
        hashMap.put("B", 20);
        hashMap.put("C", 30);

        // Performing some operations on hashMap
        for (String key : hashMap.keySet()) {
            System.out.println("HashMap Key: " + key + ", Value: " + hashMap.get(key));
        }

        // Adding entries to the MultiKeyMap
        map.put("key3", "key4", 100);
        map.put("key5", "key6", 200);

        // Performing operations on MultiKeyMap
        Integer multiValue1 = map.get("key3", "key4");
        System.out.println("MultiKeyMap Value for (key3, key4): " + multiValue1);

        /* write */ map.put("key1", "key2", 42);

        // Additional operations
        int sum = 0;
        for (Integer value : hashMap.values()) {
            sum += value;
        }
        System.out.println("Sum of HashMap values: " + sum);

        // More operations on MultiKeyMap
        Integer multiValue2 = map.get("key5", "key6");
        System.out.println("MultiKeyMap Value for (key5, key6): " + multiValue2);

        // Final read operation
        /* read */ Integer value = map.get("key1", "key2");
        System.out.println("MultiKeyMap Value for (key1, key2): " + value);
    }
}
